import React from 'react';

const Beitrag1 = () => {
    const content = {
        title: "Zahnanatomie leicht gemacht",
        description: "Lernen Sie alles 체ber die Anatomie der menschlichen Z채hne.",
    };

    return (
        <div>
            <h2>{content.title}</h2>
            <p>{content.description}</p>
        </div>
    );
};

export default Beitrag1;
